import React, { Component } from 'react';
import ItemStatic from './ItemStatic';

class StaticBlock extends Component {
    render() {
        return (
            <div className="staticblock" id="staticblock">
                <ItemStatic image={`../image/staticblock_1.png`}/>
                <ItemStatic image={`../image/staticblock_2.png`}/>
                <ItemStatic image={`../image/staticblock_3.png`}/>
                <ItemStatic image={`../image/staticblock_1.png`}/>
                <ItemStatic image={`../image/staticblock_1.png`}/>
                <ItemStatic image={`../image/staticblock_1.png`}/>
                <ItemStatic image={`../image/staticblock_1.png`}/>
                <ItemStatic image={`../image/staticblock_1.png`}/>
            </div>
        );
    }
}

export default StaticBlock;
